INSERT INTO `comidas` (`id`, `nombre`, `preparacion`, `gym_id`, `created_at`, `updated_at`) VALUES
	(1, 'Comida 1: Arroz con leche', '<p><br></p><h3>INGREDIENTES</h3><ul><li>&nbsp;1 taza de arroz</li><li>2 1/2 tazas de leche</li><li>1/3 taza de azúcar</li><li>1/2 ramita de <a href="http://www.gourmet.cl/producto/canela-entera/"><span style="text-decoration: underline;">Canela Entera Gourmet</span></a></li><li>1 cda de <a href="http://www.gourmet.cl/producto/canela-molida/"><span style="text-decoration: underline;">Canela Molida Gourmet</span></a></li><li>1/2 cda de <a href="http://www.gourmet.cl/producto/esencia-de-vainilla/"><span style="text-decoration: underline;">Esencia de Vainilla Gourmet</span></a></li></ul><p>PREPARACIÓN</p><ol><li>En una olla, ponga el arroz, la leche, la <a href="http://www.gourmet.cl/producto/canela-entera/"><span style="text-decoration: underline;">Canela Entera Gourmet</span></a>, el azúcar y la <a href="http://www.gourmet.cl/producto/esencia-de-vainilla/"><span style="text-decoration: underline;">Esencia de Vainilla Gourmet</span></a>. Cocine por aproximadamente 20 a 30 minutos a fuego bajo.</li><li>Pruebe el arroz. Si está blando, retírelo del fuego. Si no está blando todavía, deje cocinando unos minutos más hasta que se ablande.</li><li>Revuelva todo y deje enfriar. Luego refrigere.</li><li>Sirva el arroz con leche en pocillos individuales y espolvoree sobre cada uno <a href="http://www.gourmet.cl/producto/canela-molida/"><span style="text-decoration: underline;">Canela Molida Gourmet</span></a>. Si desea, puede decorar con una ramita de <a href="http://www.gourmet.cl/producto/canela-entera/"><span style="text-decoration: underline;">Canela Entera Gourmet</span></a>.</li></ol>', 1, '2024-05-19 20:16:01', '2024-06-12 21:34:53'),
	(2, 'Fruta: Manzana verde', '<p>Manzana verde</p>', 1, '2024-05-19 20:40:33', '2024-05-19 20:40:33');
