	(1, 2, 'Sentadillas', '<p><figure data-trix-attachment="{&quot;contentType&quot;:&quot;image/jpeg&quot;,&quot;filename&quot;:&quot;partes-del-cuerpo-que-se-traban-en-una-sentadilla.jpg&quot;,&quot;filesize&quot;:104843,&quot;height&quot;:1353,&quot;href&quot;:&quot;http://localhost:8000/storage/b8A3N2c555TJBic6HFAsS4PEJiqfplvTy5rMW5tG.jpg&quot;,&quot;url&quot;:&quot;http://localhost:8000/storage/b8A3N2c555TJBic6HFAsS4PEJiqfplvTy5rMW5tG.jpg&quot;,&quot;width&quot;:1000}" data-trix-content-type="image/jpeg" data-trix-attributes="{&quot;caption&quot;:&quot;sentadillas&quot;,&quot;presentation&quot;:&quot;gallery&quot;}" class="attachment attachment--preview attachment--jpg"><a href="http://localhost:8000/storage/b8A3N2c555TJBic6HFAsS4PEJiqfplvTy5rMW5tG.jpg"><img src="http://192.168.66.124:8000/storage/b8A3N2c555TJBic6HFAsS4PEJiqfplvTy5rMW5tG.jpg" width="1000" height="1353"><figcaption class="attachment__caption attachment__caption--edited">sentadillas</figcaption></a></figure></p>', 1, '2024-05-09 16:06:22', '2024-05-09 16:17:14', 3),
	(2, 2, 'Sentadilla libre', '<p><figure data-trix-attachment="{&quot;contentType&quot;:&quot;image/gif&quot;,&quot;filename&quot;:&quot;01241301-Barbell-Wide-Squat_Thighs_720.gif&quot;,&quot;filesize&quot;:1140992,&quot;height&quot;:720,&quot;href&quot;:&quot;http://localhost:8000/storage/qbLe3ilyoOEyMRzlGJITyauyWkkqfqu9940TgE68.gif&quot;,&quot;url&quot;:&quot;http://localhost:8000/storage/qbLe3ilyoOEyMRzlGJITyauyWkkqfqu9940TgE68.gif&quot;,&quot;width&quot;:720}" data-trix-content-type="image/gif" data-trix-attributes="{&quot;presentation&quot;:&quot;gallery&quot;}" class="attachment attachment--preview attachment--gif"><a href="http://localhost:8000/storage/qbLe3ilyoOEyMRzlGJITyauyWkkqfqu9940TgE68.gif"><img src="http://192.168.66.124:8000/storage/qbLe3ilyoOEyMRzlGJITyauyWkkqfqu9940TgE68.gif" width="720" height="720"><figcaption class="attachment__caption"><span class="attachment__name">01241301-Barbell-Wide-Squat_Thighs_720.gif</span> <span class="attachment__size">1.09 MB</span></figcaption></a></figure></p>', 1, '2024-05-09 16:19:47', '2024-06-02 19:20:43', 3);
INSERT INTO `entrenadors` (`id`, `users_id`, `nombre_entrenador`, `apellido_entrenador`, `telefono`, `telefono_emergencia`, `Sexo`, `especialidad`, `gym_id`, `created_at`, `updated_at`) VALUES
	(1, 1, 'entrenador_gym1', 'oasis', '09754848', '0982568154', 'Masculino', 'dfadfa', 1, '2024-05-04 00:52:59', '2024-05-04 00:52:59'),
	(2, 4, 'Juan ', 'Pérez', '0975484878', '0982568154', 'masculino', '<p>Juan Pérez es un entrenador con más de 10 años de experiencia en el mundo del fitness y la salud. Su especialidad es el entrenamiento funcional, una disciplina que se centra en ejercicios que mejoran la fuerza, la movilidad y la estabilidad del cuerpo en su conjunto. Estos ejercicios están diseñados para imitar los movimientos que se realizan en la vida cotidiana, ayudando a sus clientes a desarrollar una mejor postura, equilibrio y rendimiento físico general.</p><p>Además de su enfoque en el entrenamiento funcional, Juan es un experto en nutrición deportiva. Ha asesorado a numerosos atletas en la optimización de sus dietas para mejorar el rendimiento y la recuperación. Con un enfoque personalizado, Juan crea planes de alimentación adaptados a las necesidades individuales de cada cliente, asegurando que obtengan los nutrientes necesarios para alcanzar sus metas de salud y rendimiento.</p><p><strong>Certificaciones:</strong></p><ul><li>Certificado en Entrenamiento Funcional por la International Sports Sciences Association (ISSA)</li><li>Diplomado en Nutrición Deportiva por la American Council on Exercise (ACE)</li><li>Curso de Primeros Auxilios y Reanimación Cardiopulmonar (RCP)</li></ul><p><strong>Áreas de Enfoque:</strong></p><ul><li>Mejora de la movilidad y flexibilidad</li><li>Programas de pérdida de peso y tonificación</li><li>Aumento de la fuerza y resistencia</li><li>Asesoramiento en suplementación deportiva</li><li>Planificación de dietas personalizadas</li></ul>', 1, '2024-06-02 07:52:18', '2024-06-02 07:52:18');
