INSERT INTO `gyms` (`id`, `name`, `longitud`, `latitud`, `descripcion`, `imagen`, `categorias_id`, `created_at`, `updated_at`, `habilitado`, `location`, `ruc`, `razonsocial`, `direccion`, `servicios`) VALUES
	(1, 'Titan Fit', -57.43267250061, -23.411077648082, '<p>Bienvenido a <strong>Titan Fit</strong>, donde la fuerza y la dedicación se encuentran para transformar tu vida. Nuestro gimnasio de última generación está diseñado para ayudarte a alcanzar tus objetivos de fitness, ya sea que estés comenzando tu viaje de bienestar o buscando llevar tu entrenamiento al siguiente nivel.</p><p>En <strong>Titan Fit</strong>, creemos que cada persona merece un enfoque personalizado para alcanzar su máximo potencial. Por eso, ofrecemos una variedad de programas y clases grupales que incluyen desde entrenamiento funcional, HIIT (entrenamiento de intervalos de alta intensidad) y cardio intensivo hasta yoga, pilates y clases de baile, adaptándose a todas las edades y niveles de condición física.</p><p>Nuestras instalaciones están equipadas con tecnología de punta y cuentan con áreas especializadas para levantamiento de pesas, entrenamiento cardiovascular, y zonas de relajación. Además, disponemos de un área de spa y bienestar, donde puedes disfrutar de masajes terapéuticos, sauna y baños de vapor, perfectos para la recuperación muscular y el alivio del estrés.</p><p>En <strong>Titan Fit</strong>, nuestro equipo de entrenadores profesionales está comprometido a proporcionar orientación y apoyo constante para ayudarte a superar tus límites y alcanzar tus metas. Cada miembro de nuestro personal está altamente capacitado y certificado, garantizando que recibas el mejor asesoramiento y un entrenamiento seguro y efectivo. También ofrecemos evaluaciones físicas personalizadas y planes de entrenamiento diseñados específicamente para tus necesidades y objetivos individuales.</p><p>Para aquellos que buscan una experiencia más integral, <strong>Titan Fit</strong> ofrece programas de nutrición personalizados y asesoramiento dietético para complementar tu régimen de ejercicios. Sabemos que una buena alimentación es clave para lograr resultados duraderos, por lo que trabajamos contigo para desarrollar un plan que se ajuste a tu estilo de vida y metas.</p><p>Además de nuestras instalaciones y servicios de primera clase, <strong>Titan Fit</strong> es una comunidad de personas con ideas afines que comparten una pasión por el bienestar y el fitness. Organizamos eventos sociales, desafíos de fitness y talleres educativos para mantener a nuestros miembros motivados y conectados. Aquí, encontrarás un ambiente amigable y acogedor donde todos son bienvenidos y apoyados en su camino hacia una vida más saludable.</p><p>Únete a <strong>Titan Fit</strong> y descubre la diferencia que puede hacer un gimnasio comprometido con tu éxito. Con nosotros, no solo mejorarás tu condición física, sino que también desarrollarás una mentalidad más fuerte y resiliente. ¡Ven y forma parte de nuestra familia Titan Fit hoy mismo!</p>', '01J06WXEHAQYZC3ZZM3K77F526.png', 2, '2024-05-03 19:36:50', '2024-06-12 22:56:10', 1, '{"lat":-23.41107764808181,"lng":-57.432672500610344}', '80075982-7', 'Titan Fit', 'Pte. Franco c/ Yegros', 'Servicios personales, anexo ventas minorista'),
	(2, 'gym2', -57.360948867187496, -23.39866842071863, '<p>fadfadfa</p>', '01J06WKSN7T0FE7YX5VXBZHWB3.webp', 1, '2024-05-13 03:35:20', '2024-06-12 22:50:53', 1, '{"lat":-23.39866842071863,"lng":-57.360948867187496}', '5192306-6', 'Titan Fit', 'Pte. Franco c/ Yegros', 'Servicios personales, anexo ventas minorista'),
	(3, 'Sport club', -57.335083007812, -23.358531024441, '<p>Ubicado en el corazón de la ciudad de Concepción, el Gym Sport Club ofrece un ambiente dinámico y acogedor para personas de todas las edades y niveles de condición física. Nuestro objetivo es proporcionar un espacio donde puedas alcanzar tus metas de fitness de manera efectiva y divertida.</p><p><strong>Instalaciones de Vanguardia</strong>: Nuestras instalaciones cuentan con equipos de última generación, desde máquinas cardiovasculares hasta pesas libres, diseñadas para satisfacer las necesidades de todos los miembros. Además, disponemos de áreas especializadas para clases grupales, como spinning, zumba, yoga y entrenamiento funcional.</p><p><strong>Entrenadores Profesionales</strong>: Nuestro equipo de entrenadores certificados está comprometido a brindarte el apoyo y la orientación que necesitas para alcanzar tus objetivos. Ya sea que estés buscando perder peso, tonificar tu cuerpo o mejorar tu rendimiento deportivo, nuestros entrenadores están aquí para ayudarte en cada paso del camino.</p><p><strong>Ambiente Motivador</strong>: En el Gym Sport Club, te encontrarás rodeado de una comunidad de personas motivadas y comprometidas con su bienestar. Nuestro ambiente amigable y positivo te inspirará a superar tus límites y alcanzar tu máximo potencial.</p><p><strong>Programas Personalizados</strong>: Entendemos que cada persona es única, por lo que ofrecemos programas de entrenamiento personalizados adaptados a tus necesidades y preferencias individuales. Ya sea que prefieras entrenamiento en grupo o sesiones uno a uno, estamos aquí para diseñar un plan que funcione para ti.</p><p><strong>Conveniencia y Flexibilidad</strong>: Nos esforzamos por hacer que tu experiencia en el gimnasio sea lo más conveniente y flexible posible. Con horarios extendidos de apertura y una variedad de clases disponibles durante todo el día, puedes encontrar el momento perfecto para entrenar, sin importar tu horario.</p><p>Únete al Gym Sport Club Concepción hoy mismo y descubre cómo podemos ayudarte a alcanzar tus metas de fitness de manera efectiva y emocionante.</p><p>d</p>', '01J06WNCN3VTKBNZXPQEM68VED.jpg', 1, '2024-05-27 00:01:42', '2024-06-12 22:53:16', 1, '{"lat":-23.358531024441117,"lng":-57.33508300781249}', '5192306-6', 'Sport club', 'Pte. Franco c/ Yegros', 'Servicios personales, anexo ventas minorista');
